        .tick {
            stroke-dasharray: 29px;
            stroke-dashoffset: 29px;
            animation: .5s cubic-bezier(.25, .25, .25, 1) forwards draw;
            animation-delay: .6s
        }

        .circle {
            fill-opacity: 0;
            stroke: #219a00;
            stroke-width: 16px;
            transform-origin: center;
            transform: scale(0);
            animation: 1s cubic-bezier(.25, .25, .25, 1.25) forwards grow
        }

        @keyframes grow {
            60% {
                transform: scale(.8);
                stroke-width: 4px;
                fill-opacity: 0
            }

            100% {
                transform: scale(.9);
                stroke-width: 8px;
                fill-opacity: 1;
                fill: #219a00
            }
        }

        @keyframes draw {
            100% {
                stroke-dashoffset: 0
            }
        }

        @keyframes shake {

            0%,
            100% {
                transform: translateX(0)
            }

            25%,
            75% {
                transform: translateX(3px)
            }

            50% {
                transform: translateX(-3px)
            }
        }

        @keyframes popupOpenClose {
            0% {
                opacity: 0%
            }

            100% {
                opacity: 100%
            }
        }

        @keyframes popupClose {
            0% {
                opacity: 100%
            }

            100% {
                opacity: 0%
            }
        }

        .closeAnimation {
